ir admin=<br>istrations and what types of challenges they faced. Still, they're from ent=<br>irely different times and Obama is the first to downplay any comparisons (w=<br>isely so).<br><br>Similarities<br> * Both came from families of modest means*<br> * Both were born in another state and later moved to Illinois<br> * Both had unorthodox early education (Li<br>Read More: *url*://www.quora.com/U-S-Presidents/What-are-the-similarities-an=<br>d-differences-between-Abraham-Lincoln-and-Barack-Obama#ans2235248<br>-----<br>Question: What is it like to be the defense attorney of someone you strongl=<br>y believe to have committed the crime?<br><br>Answer from Tre Critelli<br>Whathe offers to stay up=<br> way late helping you to debug your code, thank him for his generosity and =<br>gently turn down the offer. Furthermore, don't allow him to spend money on =<br>you. Otherwise, he might start to believe that by showering you with even m=<br>ore attention, he'll be a<br>Read More: *url*://www.quora.com/Friendship/How-can-you-reduce-the-chances-t=<br>hat-your-male-friends-will-fall-for-you-romantically#ans2242381<br>-----<br><br>People You May Know on Quora<br><br>* Xiaoqi Zhu. To follow Xiaoqi, visit: *url*://www.quora.com/user/auto_follo=<br>w_back_user?target_uid=3D2945097&amp;key=3D00aa838ad69e3f99dc3234f492e8ec7b<br>* Nick Huber. To follow Nick, visit: *url*://www.quora.com/user/auto_follow_=<br>back_user?target_uid=3D29777&amp;key=3D09590a927ad9a41da875b4e5e5b6df42<br>* Alecia Li Morgan. To follow Alecia, visit: *url*://www.quora.com/user/auto=<br>_follow_back_user?target_uid=3D2722370&amp;key=3Ddf44bc81458a41c56e2f5b343d3647=<br>c6<br>* Josh Whittington. To follow Josh, visit: *url*://www.quora.com/user/auto_f=<br>ollow_back_user?target_uid=3D2468347&amp;key=3D5082cb4e8076c4a004a3332aaa37b527<br>* Chris Weigl. To follow Chris, visit: *url*://www.quora.com/user/auto_follo=<br>w_back_user?target_uid=3D2519864&amp;key=3Dd91cbdf71ee04df2b6cd06cc8678439d<br><br>-----<br>To